INSERT INTO `film` (`id`, `Titre`, `Style`, `Resume`, `Sortie`, `Langue`) VALUES
(1, 'Star Wars: Episode IV - A New Hope', 'SCIENCEFICTION', 'Luke Skywalker leaves his home planet, teams up with other rebels, and tries to save Princess Leia from the evil clutches of Darth Vader.', 1977, 'ANGLAIS'),
(2, 'Oui, mais...', 'FICTION', 'Attracted but also frightened by her sexuality, a teenage girl undergoes a brief therapy with a warm, humorous and competent psychotherapist.', 2001, 'FRANCAIS'),
(3, 'Placard, Le', 'COMEDIE', 'François Pignon, un homme au costume sombre et à l''allure discrète, est comptable dans une usine de caoutchouc, dont le secteur privilégié est le préservatif.\r\nIl est sur le point d''être licencié, lorsque sur les conseils de Belon, son voisin d''immeuble, il propage la rumeur selon laquelle il est homosexuel. \r\nSuite à ce faux coming out, les cadres de la direction décident de garder Pignon pour des raisons ''politiquement correctes''.\r\nCelui-ci passe brusquement pour un marginal, bien qu''il n''ait rien changé à son comportement. C''est le regard des autres qui va s''en trouvé modifié.', 2001, 'FRANCAIS'),
(4, 'Star Wars: Episode V - The Empire Strikes Back', 'SCIENCEFICTION', 'While Luke takes advanced Jedi training from Yoda, his friends are relentlessly pursued by Darth Vader as part of his plan to capture Luke.', 1980, 'ANGLAIS'),
(5, 'Choristes, Les', 'DRAME', 'The new teacher at a severely administered boys'' boarding school works to positively effect the students'' lives through music.', 2004, 'FRANCAIS'),
(6, 'Dans la peau de John Malkovich', 'FICTION', 'Craig, a puppeteer, takes a filing job in a low-ceilinged office in Manhattan. Although married to the slightly askew Lotte, he hits on a colleague, the sexually frank Maxine. She''s bored but snaps awake when he finds a portal leading inside John Malkovich: for 15 minutes you see, hear, and feel whatever JM is doing, then you fall out by the New Jersey Turnpike. Maxine makes it commercial, selling trips for $200; also, she''s more interested in Lotte than in Craig, but only when Lotte is inside JM. JM finds out what''s going on and tries to stop it, but Craig sees the portal as his road to Maxine and to success as a puppeteer. Meanwhile, Lotte discovers others interested in the portal.  ', 1999, 'ANGLAIS'),
(8, 'How to Lose a Guy in 10 Days', 'COMEDIE', 'Benjamin Barry is an advertising executive and ladies'' man who, \r\nto win a big campaign, bets that he can make a woman fall in love \r\nwith him in 10 days. Andie Anderson covers the \r\n''How To'' beat for ''Composure'' magazine and is assigned to \r\nwrite an article on ''How to Lose a Guy in 10 days.'' They meet in a \r\nbar shortly after the bet is made.', 2003, 'ANGLAIS'),
(9, 'Bladerunner', 'SCIENCEFICTION', 'Deckard, a blade runner, has to track down and terminate 4 replicants who hijacked a ship in space and have returned to earth seeking their maker.', 1982, 'ANGLAIS'),
(10, 'Alien', 'SCIENCEFICTION', 'A mining ship, investigating a suspected SOS, lands on a distant planet. The crew discovers some strange creatures and investigates.', 1979, 'ANGLAIS'),
(16, 'mon film ', 'FICTION', 'c''est un film trop bien', 2011, 'FRANCAIS'),
(17, 'Black Swan', 'DRAME', 'A ballet dancer wins the lead in ''Swan Lake'' and is perfect for the role of the delicate White Swan - Princess Odette - but slowly loses her mind as she becomes more and more like Odile, the Black Swan. \r\nblablabla', 2010, 'ANGLAIS'),
(21, 'Star Wars: Episode VI - Return of the Jedi ', 'SCIENCEFICTION', 'After rescuing Han Solo from the palace of Jabba the Hutt, the Rebels attempt to destroy the Second Death Star, while Luke Skywalker tries to bring his father back to the Light Side of the Force. aaaaaa', 1983, 'ANGLAIS'),
(22, 'Indiana Jones and the Kingdom of the Crystal Skull', 'FICTION', ' Famed archaeologist/adventurer Dr. Henry ''Indiana'' Jones is called back into action when he becomes entangled in a Soviet plot to uncover the secret behind mysterious artifacts known as the Crystal Skulls. ', 2008, 'ANGLAIS'),
(23, 'Raiders of the Lost Ark', 'AVENTURE', 'Archeologist and adventurer Indiana Jones is hired by the US government to find the Ark of the Covenant before the Nazis. ', 1981, 'ANGLAIS'),
(24, 'Harry Potter and the Deathly Hallows: Part 2', 'AVENTURE', 'The end begins as Harry, Ron, and Hermione go back to Hogwarts to find and destroy Voldemort''s final horcruxes, but when Voldemort finds out about their mission, the biggest battle begins and life as they know it will never be the same again.', 2011, 'ANGLAIS');
